import './grid-css.css';

const PlayArea = () => {
    console.log("Grid ")
    const cellHeight = '30px';
    const cellWidth = '30px';
    const rows = 10;
    const columns = 20;
    return (
        <div
            className="grid"
            style={{
                gridTemplateColumns: `repeat(${columns}, ${cellWidth})`,
                gridTemplateRows: `repeat(${rows}, ${cellHeight})`,
            }}
        >
            {Array.from({ length: rows * columns }, (_, index) => (
                <div key={index} />
            ))}
        </div>
    );
}

export default PlayArea;
